import React from 'react';
import Header from '../Header';

function Kiosk() {
  const categoryItem = {
    categoryId: 1,
    categoryName: 'Some Category',
    categoryDatetime: '2024-02-22'
  };

  return (
    <div>
      <Header categoryItem={categoryItem} />
    </div>
  );
}

export default Kiosk;
